import React from 'react';
import ReactDOM from 'react-dom';
import App from './App/App';
import Users from './Components/users/users';
import Contact from './Components/contact/contact';
import Notfound from './Components/notfound/notfound';
import Proto1 from './Components/Prototypes/ClickAffordance/Proto1';
import Proto2 from './Components/Prototypes/ClickAffordance/Proto2';
import Proto3 from './Components/Prototypes/ClickAffordance/Proto3';
import oldProto from './archivedLearningSpectrum/index_testPrototype1';
import './App/App.css';

import { BrowserRouter as Router, Route, Link, Switch } from "react-router-dom";

const routing = (
  <Router>
    <div>
      <Switch>
        <Route exact path="/" component={App} />
        <Route exact path="/proto1" component={Proto1} />
        <Route exact path="/proto2" component={Proto2} />
        <Route exact path="/proto3" component={Proto3} />
        <Route path="/users" component={Users} />
        <Route path="/contact" component={Contact} />
        <Route path="/oldproto" component={oldProto} />
        <Route component={Notfound} />
      </Switch>
      {/* <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/users">Users</Link>
        </li>
        <li>
          <Link to="/contact">Contact</Link>
        </li>
      </ul> */}
    </div>
  </Router>
)

ReactDOM.render(routing, document.getElementById('root'))
